import React from 'react';
import Card from './../../components/Card'
import Bt from "./../../components/Button"
import icon from './../../assets/icon.png'
import { Container, Input, Label, Img } from './index.syles';
export default function Component() {
  const app = window.document.getElementById("input");
  console.log(app);




  return (
    <Container>
      <Card  >
        <Img src={icon} />
        <Label><strong>CPF</strong></Label>
        <Input
          id="cpf"
          type="number"
          placeholder="CPF "
        />
        <Label><strong>Senha</strong></Label>
        <Input
          id="senha"
          type="password"
          placeholder="Senha " />
        <Bt title="Entrar" />
      </Card >
    </Container>
  );
}
